import React from "react";
import "./loginform.css" 

const LoginForm = () => {
    return (
        <div className="page">
              <div className="cover">
            <h1>Login</h1>
            <input type="text" placeholder="Matricula" />
            <input type="password" placeholder="Contraseña" />
            
            <div className="login-btn">Entrar</div>


        </div>

        </div>
      
    )
}

export default LoginForm
